                "TOLL_ROADS",
                "TOLL_GATES"
            ]
        },
        "name": "avoidanceTypes"
    },
    "calculationMode": {
        "type": "string",
        "example": "THE_FASTEST",
        "description": "The calculation mode for the trip. Defaults to \"THE_FASTEST\"",
        "pattern": "THE_FASTEST|THE_SHORTEST",
        "enum": [
            "THE_FASTEST",
            "THE_SHORTEST"
        ],
        "name": "calculationMode"
    },
    "callback": {
        "type": "object",
        "properties": {
            "password": {
                "type": "string",
                "name": "password",
                "description": "⏎"
            },
            "url": {
                "type": "string",
                "pattern": "(https?://[a-zA-Z0-9][a-zA-Z0-9-]+[a-zA-Z0-9]\\.[^\\s]{2,}|(https?://)?localhost(:\\d+)?(/[a-zA-Z0-9]+)*/?)",
                "name": "url",
                "description": "⏎"
            },
            "user": {
                "type": "string",
                "name": "user",
                "description": "⏎"
            }
        },
        "name": "callback",
        "description": "⏎"
    },
    "destinations": {
        "type": "array",
        "description": "Destination points in matrix",
        "items": {
            "type": "object",
            "properties": {
                "latitude": {
                    "type": "number",
                    "format": "double",
                    "example": 48.120773,
                    "description": "Point's latitude",
                    "minimum": -90,
                    "maximum": 90,
                    "exclusiveMinimum": false,
                    "exclusiveMaximum": false,
                    "name": "latitude"
                },
                "longitude": {
                    "type": "number",
                    "format": "double",
                    "example": 11.39865,
                    "description": "Point's longitude",
                    "minimum": -180,
                    "maximum": 180,
                    "exclusiveMinimum": false,
                    "exclusiveMaximum": false,
                    "name": "longitude"
                },
                "siteId": {
                    "type": "string",
                    "example": "startingPoint",
                    "description": "Optional point identifier",
                    "name": "siteId"
                }
            }
        },
        "name": "destinations"
    },
    "origins": {
        "type": "array",
        "description": "Origin points in matrix",
        "items": {
            "type": "object",
            "properties": {
                "latitude": {
                    "type": "number",
                    "format": "double",
                    "example": 48.120773,
                    "description": "Point's latitude",
                    "minimum": -90,
                    "maximum": 90,
                    "exclusiveMinimum": false,
                    "exclusiveMaximum": false,
                    "name": "latitude"
                },
                "longitude": {
                    "type": "number",
                    "format": "double",
                    "example": 11.39865,
                    "description": "Point's longitude",
                    "minimum": -180,
                    "maximum": 180,
                    "exclusiveMinimum": false,
                    "exclusiveMaximum": false,
                    "name": "longitude"
                },
                "siteId": {
                    "type": "string",
                    "example": "startingPoint",
                    "description": "Optional point identifier",
                    "name": "siteId"
                }
            }
        },
        "name": "origins"
    },
    "restrictionZones": {
        "type": "array",
        "description": "List of restriction zone created in Restriction Zone API",
        "items": {
            "type": "string"
        },
        "name": "restrictionZones"
    },
    "speedPreferences": {
        "type": "array",
        "description": "List of preferences related to road speeds and/or preference",
        "items": {
            "type": "object",
            "properties": {
                "roadType": {
                    "type": "string",
                    "example": "LOCAL_ROAD",
                    "description": "Type of the road",
                    "pattern": "FERRY|PENALIZED_LOCAL_ROAD|LOCAL_ROAD|PENALIZED_SECONDARY_ROAD|SECONDARY_ROAD|PENALIZED_MAIN_ROAD|MAIN_ROAD|EXPRESSWAY|HIGHWAY",
                    "enum": [
                        "FERRY",
                        "PENALIZED_LOCAL_ROAD",
                        "LOCAL_ROAD",
                        "PENALIZED_SECONDARY_ROAD",
                        "SECONDARY_ROAD",
                        "PENALIZED_MAIN_ROAD",
                        "MAIN_ROAD",
                        "EXPRESSWAY",
                        "HIGHWAY"
                    ],
                    "name": "roadType"
                },
                "speed": {
                    "type": "integer",
                    "format": "int32",
                    "example": 60,
                    "description": "Road speed",
                    "minimum": 0,
                    "exclusiveMinimum": false,
                    "name": "speed"
                },
                "speedAtToll": {
                    "type": "integer",
                    "format": "int32",
                    "example": 30,
                    "description": "Road speed when there is a toll in the road segment",
                    "minimum": 0,
                    "exclusiveMinimum": false,
                    "name": "speedAtToll"
                }
            }
        },
        "name": "speedPreferences"
    },
    "startDate": {
        "type": "integer",
        "format": "int64",
        "example": 1511901826456,
        "description": "Calculation start date for the matrix problem",
        "name": "startDate"
    },
    "tripProfile": {
        "type": "string",
        "example": "BRAZIL",
        "description": "Trip profile name, previously created",
        "minLength": 1,
        "maxLength": 2147483647,
        "pattern": "[0-9a-zA-Z]+",
        "name": "tripProfile"
    },
    "vehicleSpecification": {
        "type": "object",
        "properties": {
            "loadTypes": {
                "type": "array",
                "description": "Vehicle load types",
                "items": {
                    "type": "string",
                    "enum": [
                        "GOODS",
                        "PERSONS",
                        "AGRICULTURAL_PRODUCTS",
                        "COAL",
                        "BUILDING_PRODUCTS",
                        "HEATH_WASTES",
                        "SAND_GRAVELS",
                        "RAW_MATERIALS",
                        "NATURAL_RESOURCES"
                    ]
                },
                "name": "loadTypes"
            },
            "maxHeight": {
                "type": "number",
                "format": "double",
                "example": 3.5,
                "description": "Max vehicle height, in meters",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxHeight"
            },
            "maxLength": {
                "type": "number",
                "format": "double",
                "example": 10,
                "description": "Max vehicle length, in meters",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxLength"
            },
            "maxLengthBetweenAxles": {
                "type": "number",
                "format": "double",
                "example": 1.8,
                "description": "Max vehicle length between axles, in meters",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxLengthBetweenAxles"
            },
            "maxWeight": {
                "type": "number",
                "format": "double",
                "example": 15.5,
                "description": "Max vehicle weight, in tons",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxWeight"
            },
            "maxWeightForDangerousMaterials": {
                "type": "number",
                "format": "double",
                "example": 14,
                "description": "Max vehicle weight for dangerous materials, in tons",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxWeightForDangerousMaterials"
            },
            "maxWeightForExplodingMaterials": {
                "type": "number",
                "format": "double",
                "example": 10,
                "description": "Max vehicle weight for exploding materials, in tons",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxWeightForExplodingMaterials"
            },
            "maxWeightForPollutingMaterials": {
                "type": "number",
                "format": "double",
                "example": 5.5,
                "description": "Max vehicle weight for polluting materials, in tons",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxWeightForPollutingMaterials"
            },
            "maxWeightPerAxle": {
                "type": "number",
                "format": "double",
                "example": 5.2,
                "description": "Max vehicle weight per axle, in tons",
                "name": "maxWeightPerAxle"
            },
            "maxWidth": {
                "type": "number",
                "format": "double",
                "example": 2.3,
                "description": "Max vehicle width, in meters",
                "minimum": 0,
                "exclusiveMinimum": false,
                "name": "maxWidth"
            }
        },
        "name": "vehicleSpecification",
        "description": "⏎"
    }
}

